import React from "react";
import { List } from "antd";
import { PokemonNode, PokemonItem } from "../../typescript/interfaces";

export default (props: { list: PokemonNode<PokemonItem>[] }) => {
  return (
    <List
      grid={{ gutter: 16, column: 4 }}
      dataSource={props.list}
      render></List>
  );
};
